angular.module('hthsLunch.panel', ['hthsLunch.core.itemService',
	'hthsLunch.core.orderService'
]);

angular.module('hthsLunch', [
	'ui.router',
	'hthsLunch.panel'
]).config(['$locationProvider', function($locationProvider) {
	$locationProvider.html5Mode(true).hashPrefix('!');
}]);
angular.module('hthsLunch.panel')
	.config(['$stateProvider', '$urlRouterProvider',
		function($stateProvider, $urlRouterProvider) {
			$stateProvider
				.state('dashboard', {
					url: '/panel',
					views: {
						'main': {
							controller: 'DashboardController',
							templateUrl: '/modules/panel/partials/dashboard.html'
						},
						'dashboard': {
							controller: 'DashboardController',
							templateUrl: '/modules/panel/partials/index.html'
						}
					}
				}).state('dashboard.items', {
					url: '/items',
					views: {
						'main': {
							controller: 'DashboardController',
							templateUrl: '/modules/panel/partials/dashboard.html'
						},
						'dashboard': {
							controller: 'DashboardItemsController',
							templateUrl: '/modules/panel/partials/items.html'
						}
					}
				}).state('dashboard.orders', {
					url: '/orders',
					views: {
						'main': {
							controller: 'DashboardController',
							templateUrl: '/modules/panel/partials/dashboard.html'
						},
						'dashboard': {
							controller: 'DashboardOrdersController',
							templateUrl: '/modules/panel/partials/orders.html'
						}
					}
				}).state('dashboard.analytics', {
					url: '/analytics',
					views: {
						'main': {
							controller: 'DashboardController',
							templateUrl: '/modules/panel/partials/dashboard.html'
						},
						'dashboard': {
							controller: 'DashboardAnalyticsController',
							templateUrl: '/modules/panel/partials/analytics.html'
						}
					}
				});
		}
	]);
angular.module('hthsLunch.panel').controller('DashboardController', ['$scope',
	function($scope) {}
]).controller('DashboardItemsController', ['$scope', 'Item',
	function($scope, Item) {
		Item
			.query()
			.$promise.then(function(items) {
				$scope.items = items;
			});
	}
]);
angular.module('hthsLunch.panel');
angular.module('hthsLunch.core.itemService', ['ngResource']).factory('Item', [
	'$resource',
	function($resource) {
		return $resource('/api/panel/items/:itemId', {}, {
			update: {
				method: 'PUT'
			}
		});
	}
]);
angular.module('hthsLunch.core.orderService', ['ngResource']).factory('Order', [
	'$resource',
	function($resource) {
		return $resource('/api/panel/orders/:orderId', {}, {
			update: {
				method: 'PUT'
			}
		});
	}
]);